import React from "react";
import Card from "./components/Card";

class List extends React.Component{
    constructor(){
        super();
        this.state={
            imgLinks:[],
            cards:[]
        }
    }
    async componentDidMount(){
        this.fetchItems();
    }
    async fetchItems(){
        const data= await fetch('https://dog.ceo/api/breed/husky/images/random/6');
        const items=data.json();
        console.log(items);
        this.setState({imgLinks:items})
        let i=0;
        const cards=items.map(item=>{
            console.log(item);
            return <Card key={i++} imgUrl={item}/>
        });
        this.setState({cards:cards});
        
    }


    render(){
        return(
            <div id="cards" className="row">
                {this.state.cards}
            </div>);
        }
}
export default List;
